import { jsPDF } from "jspdf";
var regular =
  "";

var light =
  "";
var callAddFont = function () {
  this.addFileToVFS("Oswald-Regular-normal.ttf", regular);
  this.addFileToVFS("Oswald-Regular-light.ttf", light);
  this.addFont("Oswald-Regular-normal.ttf", "Oswald-Regular", "normal");
  this.addFont("Oswald-Regular-light.ttf", "Oswald-light", "light");
};
jsPDF.API.events.push(["addFonts", callAddFont]);

export const addOswald = () => {
  jsPDF.API.events.push(["addFonts", callAddFont]);
};
